import React from 'react';
import logo from './logo.svg';
import './App.css';
import { Link } from 'react-router-dom';
import TopBanner from './Blah';
import MovieList from './Movies';
import HomeInfo from './HomeInfo';
import SiteHeader from './Header';
import FullMovieList from './MoviesFull';

function Podcasts() {
  return (
    <>
      <SiteHeader></SiteHeader>
      <h1>Welcome to the Podcast Page</h1>
      <a href="https://baconsale.com">Check Out My Podcasts</a>
    </>
  );
}

function App() {
  return (
    <div className="App">
      <SiteHeader />
      <Podcasts></Podcasts>
      <TopBanner saying="Tom's React Website - Home"></TopBanner>
      <HomeInfo />
      <FullMovieList />
      <MovieList />
      <TopBanner saying="Tom's React Website - About"></TopBanner>
    </div>
  );
}

export default App;
